    let Series = 'netFlix';
    if(Series === 'netFliX'){
        return (
           <Netflix />
        )
    }else{
        return (

        <Cards key={Sdata[2].id}
        imgsrc={Sdata[2].imgsrc}
        title={Sdata[2].title}
        sname={Sdata[2].sname}
        link={Sdata[2].link} />
        
    )
        
    }
}

const App = ()=>{
    return(
    <>  <h1 className="heading_style">LIST OF TOP 5 NETFLIX SERIES IN 2021</h1>
<div className="flexBox">

 <State />

    
</div>
</>
    )
}

export default App;
